import style from "./SearchInput.module.scss";

export default function SearchInput({ clearSearch, setSearchValue }) {
  return (
    <div className={style["pagination__search"]}>
      <input
        onChange={(e) => setSearchValue(e.target.value)}
        className={style["search"]}
        placeholder="Поиск"
      ></input>
      <button className={style["delete"]} onClick={clearSearch}></button>
    </div>
  );
}
